def genome_minimum_skew(genome):
    # Initializing the skew values with initial value as 0.
    skew = [0] 
    for i in range(len(genome)):
        # Incrementing the skew value by 1 for if the char is 'G'.
        if genome[i] == 'G':
            skew.append(skew[i] + 1)  
        # Decrementing the skew value by 1 for if the char is 'C'.
        elif genome[i] == 'C':
            skew.append(skew[i] - 1)  
        else:
            skew.append(skew[i])
    
    # Finding the minimum skew value and storing it as the min_skew.
    min_skew = min(skew)
    # FInding the minimum skew indices.
    min_skew_indices = [i for i, val in enumerate(skew) if val == min_skew]
    return min_skew_indices

genome = """"""
min_skew_indices = genome_minimum_skew(genome)
output = ' '.join(map(str, min_skew_indices))
print(output)
